import React from "react";

//Material UI
import { Button, Grid } from "@material-ui/core";

const HomeButton = ({ content, startIcon, endIcon, color }) => {
  return (
    <Grid
      container
      justify="center"
      style={{
        margin: "22px",
      }}
    >
      <a href="#Directory">
        <Button
          variant="contained"
          color={color}
          startIcon={startIcon}
          endIcon={endIcon}
        >
          {content}
        </Button>
      </a>
    </Grid>
  );
};

export default HomeButton;
